SELECT COUNT(*) as agg_0 FROM "info_type" LEFT OUTER JOIN "movie_info_idx" ON "info_type"."id" = "movie_info_idx"."info_type_id" LEFT OUTER JOIN "title" ON "movie_info_idx"."movie_id" = "title"."id" LEFT OUTER JOIN "cast_info" ON "title"."id" = "cast_info"."movie_id" LEFT OUTER JOIN "char_name" ON "cast_info"."person_role_id" = "char_name"."id" LEFT OUTER JOIN "movie_keyword" ON "title"."id" = "movie_keyword"."movie_id"  WHERE ("movie_info_idx"."movie_id" <= 1414838 OR ("movie_info_idx"."movie_id" >= 1279891 AND "movie_info_idx"."movie_id" >= 64702)) AND "char_name"."name" LIKE '%Dr.%' AND "movie_keyword"."id" >= 133602;